import React from 'react';

const SpecialThemeSection = () => {
  return (
    <section className="special-theme-section">
      <div className="special-theme-title">Special Theme</div>
      <div className="special-theme-main">
        Data Science : Unseen patterns and Decision
      </div>
    </section>
  );
};

export default SpecialThemeSection;
